drop table monitoring;
drop table obstacles;
drop table users;
drop table children;
drop table points_of_interest;
drop table interactions;
drop table notifications;
-- Create tables
CREATE TABLE Users
(
    Id_user INTEGER NOT NULL,
    username VARCHAR(50) unique,
    password VARCHAR(50),
    Name VARCHAR(50),
    Email VARCHAR(50) unique,
    Nr_children INTEGER,
    CONSTRAINT users_pk PRIMARY KEY(Id_user)
);

CREATE TABLE Children
(
    Id_child INTEGER NOT NULL,
    Name VARCHAR(50),
    Age INTEGER,
    Gender VARCHAR(10),
    Nr_tutor INTEGER,
    Location_x NUMBER,
    Location_y NUMBER,
    CONSTRAINT children_pk PRIMARY KEY(Id_child)
);

CREATE TABLE Obstacles
(
    Id_obstacle INTEGER NOT NULL,
    Name VARCHAR(30),
    Type VARCHAR(20),
    Location_x NUMBER,
    Location_y NUMBER,
    CONSTRAINT obstacles_pk PRIMARY KEY(Id_obstacle)
);

CREATE TABLE Points_of_interest
(
    Id_point INTEGER NOT NULL,
    Id_child INTEGER NOT NULL,
    Name VARCHAR(30),
    Location_x NUMBER,
    Location_y NUMBER,
    CONSTRAINT points_of_interest_pk PRIMARY KEY(Id_point, Id_child)
);

CREATE TABLE Interactions
(
    Id_child INTEGER NOT NULL,
    Id_contact INTEGER NOT NULL,
    Date_i TIMESTAMP NOT NULL,
    Location_x NUMBER,
    Location_y NUMBER,
    Type_i VARCHAR(20),
    CONSTRAINT interactions_pk PRIMARY KEY(Id_child, Id_contact, Date_i)
);

CREATE TABLE Notifications
(
    Id_child INTEGER NOT NULL,
    Date_n TIMESTAMP NOT NULL,
    Id_interest INTEGER,
    Distance INTEGER,
    CONSTRAINT notifications_pk PRIMARY KEY(Id_child, Date_n)
);

CREATE TABLE Monitoring
(
    Id_user INTEGER NOT NULL,
    Id_child INTEGER NOT NULL,
    CONSTRAINT monitoring_pk PRIMARY KEY(Id_user, Id_child)
);

