declare
v_id integer;
v_username varchar2(40);
v_password varchar2(30);
v_name varchar2(40);
v_email varchar2(50);
v_age integer;
v_gender varchar2(10);
begin
v_id:=1;
loop

select name into v_name from users where id_user=v_id;
select replace(v_name,' ','.') into v_name from dual;
v_email:=v_name ||v_id|| '@yahoo.com';
v_username:=v_name||v_id;
v_password:=v_name||v_id;

update users set username=v_username,password=v_password,email=v_email,nr_children=0 where id_user=v_id;

v_id:=v_id+1;

exit when v_id=10101;
end loop;
--updatam copii
begin
v_id:=1;
loop
v_age:=dbms_random.value(1,10);
if(mod(v_id,2)=0)
  then v_gender:='male';
else v_gender:='female';
end if;

update children set age=v_age,gender=v_gender,nr_tutor=0,location_x=v_id,location_y=v_id where id_child=v_id;
v_id:=v_id+1;

exit when v_id=12096;
end loop;
end;
end;

